How to use `$size` with embedded document?<p>I'm having difficulty getting the size of arrays within embedded documents.</p>
<p>Given a collection with some document:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;_id&quot;: { &quot;$oid&quot;: &quot;60e26137600b71f2939ebbe7&quot; },
    &quot;name&quot;: &quot;Outer doc&quot;,
    &quot;inner_docs&quot;: [
        { &quot;name&quot;: &quot;one&quot;, &quot;vals&quot;: [1,2,3,4,5] },
        { &quot;name&quot;: &quot;two&quot;, &quot;vals&quot;: [1,2,3,4] },
        { &quot;name&quot;: &quot;three&quot;, &quot;vals&quot;: [1,2,3] }
    ]
}
</code></pre>
<p>By applying a <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/project/" rel="nofollow noreferrer"><code>$project</code></a> stage in <a href="https://docs.mongodb.com/manual/aggregation/" rel="nofollow noreferrer">aggregation</a> with <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/size/" rel="nofollow noreferrer"><code>$size</code></a> like:</p>
<pre class="lang-json prettyprint-override"><code>{
  &quot;outer_num&quot;: { &quot;$size&quot;: &quot;$inner_docs&quot; },
  &quot;inner_docs.num_vals&quot;: { &quot;$size&quot;: &quot;$inner_docs.vals&quot; }
}
</code></pre>
<p>I get the resultant doc:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;_id&quot;: { &quot;$oid&quot;: &quot;60e26137600b71f2939ebbe7&quot; },
    &quot;inner_docs&quot;: [
        { &quot;name&quot;: &quot;one&quot;, &quot;num_vals&quot;: 3 },
        { &quot;name&quot;: &quot;two&quot;, &quot;num_vals&quot;: 3 },
        { &quot;name&quot;: &quot;three&quot;, &quot;num_vals&quot;: 3 }
    ],
    &quot;outer_num&quot;: 3,
}
</code></pre>
<p><code>outer_num</code> is correct, but <code>num_vals</code> is not, it should be the values <code>5</code>, <code>4</code> and <code>3</code> respectively.</p>
<p>How could I fix this?</p>

